import styled from 'styled-components';

export const Container = styled.div`
    display: flex;
    flex-direction: column;
    min-width: 0;
    width: 20%;
    background-color: white;
    border: 1px solid rgba(0,0,0,0.125);
    border-radius: 0.25rem;
    overflow: hidden;
`;
